import React from 'react';
import './Skills.css';

function Security() {

  const skills = [
    { id: 1, title: 'Kali', description: 'Description de la compétence', xp: '3 years', level: 'Moderate', image: 'kali.png' },
    { id: 2, title: 'KQL', description: 'Description de la compétence', xp: '', level: '', image: 'kql.png' },
    { id: 3, title: 'Splunk', description: 'Description de la compétence', xp: '', level: '', image: 'splunk.png' },
    { id: 4, title: 'ELK Elastic', description: 'Description de la compétence', xp: '', level: '', image: 'elk.png' },
    { id: 5, title: 'Microsoft Defender', description: 'Description de la compétence', xp: '', level: '', image: 'defender.png' },
    { id: 6, title: 'Sysmon', description: 'Description de la compétence', xp: '', level: '', image: 'sysmon.png' },
    { id: 7, title: 'MITRE ATT&CK', description: 'Description de la compétence', xp: '', level: '', image: 'mitre.png' },
    { id: 8, title: 'OWASP Top 10', description: 'Description de la compétence', xp: '', level: '', image: 'owasp.png' },
  ];

  return (
    <div className="skills-container">
      <div className="skill-thumbnails">
        {skills.map(skill => (
          <div key={skill.id} className="skill-thumbnail">
            <div className="thumbnail-image-s">
              <img src={skill.image} alt={skill.title} />
            </div>
            <div className="skill-details">
              <h2>{skill.title}</h2>
              <p className='xp'>{skill.xp} </p>
              <p className='level'>{skill.level} </p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Security;
